webpackJsonp([0xfd5c45f3dd7e],{556:function(e,n){e.exports={data:{markdownRemark:{html:'<p>Дополнительно в PlayOnLinux установить только <em>gecko</em>, в настройках wine - эмулировать windows7\n— Ссылка на скачку(torrent): <a href="http://nnm-club.me/forum/viewtopic.php?t=471300">http://nnm-club.me/forum/viewtopic.php?t=471300</a></p>\n<p>[cut]</p>\n<p>—  <em>1</em>\n— Инструкция по установке и лечению(с форума):\n— На Windows Vista и 7 запускать установку и патч в режиме администратора.\nul</p>\n<ul>\n<li>Установить 710sp0.exe</li>\n<li>При установке указать ключ Grassington North Yorkshire_LICENCE.lxk (Лежит в папке)</li>\n<li>По завершении установки запустить патч LXK Proteus LXK Proteus 7.10 SP0 ENG v1.0.1.exe (опять-же через запуск .exe на этом витруальном диске)</li>\n<li>Скопировать содержимое папки "РУССИФИКАТОР" в папку "BIN" , где установлена программа\n/ul\n—  <em>2</em>\n— После установки перейти в папку\n"/.wine/drive_c/Program Files/Labcenter Electronics/Proteus 7 Professional" и потом переименовать "SAMPLES" в "Samples"\n— Страница на WineHQ:\n— <a href="https://appdb.winehq.org/objectManager.php?sClass=version&#x26;iId=9846&#x26;iTestingId=63219">https://appdb.winehq.org/objectManager.php?sClass=version&#x26;iId=9846&#x26;iTestingId=63219</a></li>\n</ul>',frontmatter:{date:"2015-09-30",path:"/page/proteus-710-sp0-rus-wine",title:"Proteus 7.10 SP0 Rus Wine"}}},pathContext:{}}}});
